import React from 'react';
import './index.css';
import {NavLink} from 'react-router-dom';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

function Home() {
  return (
    <>
      <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
      <div style={{color:" rgb(176, 176, 176)"}} class = "navbar-brand">Project</div>
        <div  class="container-fluid d-flex justify-content-center ">
          
        <ul class="navbar-nav ">
            <li class="nav-item">
              <NavLink class="nav-link p-5" to="/">HOME</NavLink>
            </li>
            <li class="nav-item">
              <NavLink class="nav-link" to="/about">ABOUT</NavLink>
            </li>
            <li class="nav-item">
              <NavLink class="nav-link" to="/services">SERVICES</NavLink>
            </li>
            <li class="nav-item">
              <NavLink class="nav-link" to="/contact">CONTACT US</NavLink>
            </li>
          </ul>
        </div>
      </nav>
    </>
  )
}

export default Home;
